            owl:allValuesFrom :moho ;
            owl:onProperty :has_lower_boundary ],
        :geosphere_layer ;
    owl:equivalentClass :skin_layer .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:geologic_feature rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :geosphere ;
            owl:onProperty :has_realm ],
        owl:Thing ;
    :alt_label "Geologic Feature",
        "Geological Feature" ;
    :definition "A geologic feature is a conceptual feature a that is hypothesized to exist coherently in the Earth that results from geological processes"@en ;
    :example "Individuals: Lake Eyre Basin, Sarmatian Craton, Victoria Point Sandbar, Mount Erebus Volcano. Subclasses: Basin, Craton, Shield, Province, Sub-Province."@en ;
    :scope_note "Geologic Features include sedimentary basins, stratigraphic units, non-stratigraphic (lithodemic) units, stratigraphic event features, provinces, tectonic and structural features, georesource accumulations, and geologically significant sites, among others"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:geologic_structure rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :geosphere ;
            owl:onProperty :has_realm ],
        :geosphere,
        :solid_earth .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:geosphere_layer rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :geosphere ;
            owl:onProperty :has_realm ],
        :global_planetary_layer,
        :planetary_layer,
        :subsurface .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lithosphere rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :rock ;
            owl:onProperty :contains_material ],
        :geosphere_layer .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mantle rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :moho ;
            owl:onProperty :has_upper_boundary ],
        :geosphere_layer .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:transitional_lithosphere rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_planetary_structure ;
            owl:someValuesFrom :transitional_crust ],
        :geosphere_layer .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:peripheral_foreland_basin rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :flysch_basin ;
            owl:onProperty :has_planetary_structure ],
        [ a owl:Restriction ;
            owl:allValuesFrom :molasse ;
            owl:onProperty :has_substance ],
        :basin .
